import RestaurantSignup from "./components/RestaurantSignup.jsx";
import RestaurantDashboard from "./components/RestaurantDashboard.jsx";
import "bootstrap/dist/css/bootstrap.min.css"


function App() {
  return (
    <div className="App">
      <Login />
      <CustomerSignup />
      <RestaurantSignup />
      <RestaurantDashboard />
   </div>
  );
}

export default App;
